import React, {Component} from 'react';
import Conn from "./Conn";

class Connect extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <ul className="timeline">
                        <Conn connclass="" connimg="../img/SEO.jpg" conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="timeline-inverted" connimg="../img/SEO.jpg" conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="" connimg="../img/SEO.jpg" conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="timeline-inverted" connimg="../img/SEO.jpg" conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line="line"/>
                        <Conn connclass="" connimg="../img/SEO.jpg" conntitle="Company" conncontent="Tạo ra sản phẩm tốt nhất cho kH" line=""/>
                        </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default Connect;
